We should add support for the EC2 NAT gateway resource.

{quote}
The AWS::EC2::NatGateway resource creates a network address translation (NAT) gateway in the specified private subnet. Use a NAT gateway to allow instances in a private subnet to connect to the Internet or to other AWS services, but prevent the Internet from initiating a connection with those instances.
{quote}

http://docs.aws.amazon.com/AWSCloudFormation/latest/UserGuide/aws-resource-ec2-natgateway.html
